    socket.on('deploy_loader', function (data) {
        $("#wizard").remove();
        $("#event-container").prepend(data.new_html_content);
    });

    socket.on('update_statmenu', function (data) {
        for (let item in data) {
            $(`#stat_${item} .stat_descriptor`).text(data[item]);
        }
    });

    socket.on('update_progress', function (data) {
        console.log(data);
        // get css width of progress bar
        var width = $('#b1').css('width');
        width = parseFloat(width.slice(0, -2));
        var parentWidth = $('#b1').offsetParent().css('width');
        parentWidth = parseFloat(parentWidth.slice(0, -2));
        var percent = 100*width/parentWidth;

        width = percent + data.progress
        $('#b1').css('width', `${width}%`);
    });

    socket.on('blank_canvas', function (data) {
        $("#loader").remove();
        $("#stat_menu").prepend(data.new_html_content);
        $(".timeline").css('opacity', '100');
    });

    socket.on('remove_event_modal', function (data) {
        $('[event-id="' + data['event_id'] + '"]').remove();
    });

    socket.on('drop_event', function (data) {
        $("#event-container").prepend(data.new_html_content);
    });

    socket.on('populate_starting_state', function (data) {
        $("#event-container").prepend(data.new_html_content);
    });

